A concentração da carreata teve início às 8h desta sexta-feira (4) na Avenida do Samba, ao lado do Sambódromo, bairro Dom Pedro. Ao todo, 25 carros, além de um carro de som, saíram da concentração com destino à sede do Governo do Amazonas, no bairro da Compensa. Os manifestantes também devem seguir para a Assembleia Legislativa do Estado (Aleam).
Durante o percurso da carreata, a categoria também passou pela sede do Ministério Público do Amazonas, na Ponta Negra. "O principal objetivo é chamar atenção do governador do Estado que não nos atende e, no ano de 2020, não atendeu nenhuma de nossas reivindicações e nenhum dos nossos ofícios onde pedimos audiência com ele para tratar das questões da categoria", disse.

